    const plots = 24;
    const datapoints = 500;
    const margin = {top: 10, right: 10, bottom: 30, left: 30};
    const width = 250 - margin.left - margin.right;
    const height = 250 - margin.top - margin.bottom;
    const origin = {x: width / 2, y: height / 2};
    const xScale = d3.scaleLinear().domain([-1.1029080748558044, 1.1029080748558044]).range([0, width]);
    const yScale = d3.scaleLinear().domain([-1.1029080748558044, 1.1029080748558044]).range([height, 0]);
    const markerSize = 3.5;
    const lineWidth = 1;
    const subtitles = ['Hidden states', 'Hidden states', 'Hidden states', 'Hidden states', 'Hidden states', 'Hidden states', 'Hidden states', 'Hidden states', 'Reconstrucions (standard)', 'Reconstrucions (standard)', 'Reconstrucions (standard)', 'Reconstrucions (standard)', 'Reconstrucions (standard)', 'Reconstrucions (standard)', 'Reconstrucions (standard)', 'Reconstrucions (standard)', 'Reconstrucions (gated)', 'Reconstrucions (gated)', 'Reconstrucions (gated)', 'Reconstrucions (gated)', 'Reconstrucions (gated)', 'Reconstrucions (gated)', 'Reconstrucions (gated)', 'Reconstrucions (gated)'];

    const tooltip = d3.select("body")
        .append("div")
        .style("position", "absolute")
        .style("background", "#eee")
        .style("padding", "6px")
        .style("border", "1px solid black")
        .style("border-radius", "5px")
        .style("pointer-events", "none")
        .style("visibility", "hidden")
        .style("font-size", "12px")

    const svgContainers = d3.select("#svg-containers")

        .data(d3.range(plots))
        .enter()
        .append("div")
        .attr("class", "plot-container")
        .each(function (d, i) {
            const node = d3.select(this);
            node.append("span").html(subtitles[i]);
            node.append("svg")
                .attr("class", "plot")
                .attr("width", width + margin.left + margin.right)
                .attr("height", height + margin.top + margin.bottom)
                .append("g")
                .attr("transform", `translate(${margin.left},${margin.top})`);
        });


    const drawPlot = (plotIdx, timeIdx) => {
        const plot = d3.selectAll("svg.plot").filter((_, i) => i === plotIdx);
        plot.selectAll("*").remove();

        plot.selectAll(".line")
            .data(data.filter(d => d.plot === plotIdx && d.timestep === timeIdx)[0].data)
            .enter().append("line")
            .attr("class", "line")
            .attr("x1", origin.x)
            .attr("y1", origin.y)
            .attr("x2", d => xScale(d.x))
            .attr("y2", d => yScale(d.y))
            .attr("stroke", d => d.color)
            .attr("stroke-width", lineWidth)

        plot.selectAll(".point")
            .data(data.filter(d => d.plot === plotIdx && d.timestep === timeIdx)[0].data)
            .enter().append("circle")
            .attr("class", "point")
            .attr("r", markerSize)
            .attr("cx", d => xScale(d.x))
            .attr("cy", d => yScale(d.y))
            .attr("fill", d => d.color)
            .each(function(d, i) { d.index = i; d.plot = plotIdx; })
            .on("mouseover", function(event, d) {
                if (1 > 1) return;
                findConnectedPoints(d, plotIdx).each(function(pointData) {
                    showTooltip(d3.select(this), pointData, event);
                });
            })
            .on("mouseout", function(event, d) {
                if (1 > 1) return;
                findConnectedPoints(d, plotIdx).each(function(connectedPointData) {
                    hideTooltip(d3.select(this));
                });
            });

        plot.append("g")
            .attr("transform", `translate(0,${height-1})`)
            .call(d3.axisBottom(xScale).tickValues([-1, 0, 1]).tickFormat(d3.format(".0f")).tickSize(0))
            .selectAll("text")
            .attr("dy", "11px").attr("font-size", "13px");

        plot.append("g")

            .selectAll("text")
            .attr("dx", "-2px").attr("font-size", "13px");

        plot.append("g")
            .attr("transform", `translate(0,1)`)
            .call(d3.axisTop(xScale).tickValues([]).tickSize(0))
            .selectAll("text").remove();

        plot.append("g")
            .attr("transform", `translate(${width-1},0)`)
            .call(d3.axisRight(yScale).tickValues([]).tickSize(0))
            .selectAll("text").remove();

        plot.selectAll(".domain")
            .style("stroke-width", "2px");  // Set stroke width

    };

    const drawAllPlots = (timeIdx) => {
        d3.range(plots).forEach(plotIdx => drawPlot(plotIdx, timeIdx));
        
    };

    drawAllPlots(0);

    let interval;
    let slider = d3.select('#slider');
    slider.on('input', function() { drawAllPlots(+this.value); });

    function togglePlayPause() {
        if (interval) {
            clearInterval(interval);
            interval = null;
        } else {
            interval = setInterval(
                function() {
                    let val = +slider.property('value');
                    slider.property('value', (val + 1) % timestep);
                    drawAllPlots((val + 1) % timestep);
                },
                20.0
            );
        }
    }

    function findConnectedPoints(d, plotIdx) {
        return d3.selectAll(".point")
            .filter(p => p.index === d.index && (3 ? (p.plot - plotIdx) % 8 == 0 : p.plot == plotIdx))
    }

    function showTooltip(point, pointData, event) {
        point.attr("fill", "red").attr("r", markerSize * 1.5);

        const pointCoords = point.node().getBoundingClientRect();

        const tooltip = d3.select("body").append("div")
            .attr("class", "tooltip")
            .style("position", "absolute")
            .style("background", "#eee")
            .style("padding", "6px")
            .style("border", "1px solid black")
            .style("border-radius", "5px")
            .style("pointer-events", "none")
            .style("visibility", "visible")
            .style("font-size", "12px")
            .style("font-family", "monospace")
            .html(`x: ${pointData.x.toFixed(4)}, y: ${pointData.y.toFixed(4)}`)
            .style("top", (window.scrollY + pointCoords.top - 10) + "px")
            .style("left", (window.scrollX + pointCoords.left + 20) + "px");
    }

    function hideTooltip(point) {
        point.attr("fill", d => d.color).attr("r", markerSize);
        d3.selectAll(".tooltip").remove();
    }
